import React from 'react';
import './contact'

function Contact() {
    return (
        <div className='Contacts'>
            <div className='font-size: large'>
                <a href='https://www.linkedin.com/in/jacob-eik-1b7736160'>LinkedIn</a>
                <br />
                <a href='https://github.com/JelloElephant'>GitHub</a>
                <br />
                <a href='https://learn.unity.com/u/64ee4110edbc2a63a9632e83/?tab=profile'>Unity</a>
                <br />
                <a href='mailto:eik995@hotmail.com'>eik995@hotmail.com</a>
                <br />
            </div>
        </div>
    )
}
export default Contact;
